      <div className="caja" style={{ width: "200px", height: "300px", background:"yellow" }}></div>
      <div className="caja" style={{ width: "200px", height: "300px", background:"blue" }}></div>
      <div className="caja" style={{ width: "200px", height: "300px", background:"green" }}></div>
      <div className="caja" style={{ width: "200px", height: "300px", background:"yellow" }}></div>
      <div className="caja" style={{ width: "200px", height: "300px", background:"red" }}></div>
      <div className="caja" style={{ width: "200px", height: "300px", background:"green" }}></div>
      <div className="caja" style={{ width: "200px", height: "300px", background:"" }}></div>
    </Container>
  );
};

const Container = styled.div`
  width: 100%;
  height: 100%;
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  align-items: center;
  justify-content: center;
`;
